import React from 'react';
import AppBar from '@material-ui/core/AppBar';
import Button from '@material-ui/core/Button';
import CssBaseline from '@material-ui/core/CssBaseline';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Link from '@material-ui/core/Link';
import { makeStyles } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';

import { BrowserRouter as Router, NavLink } from "react-router-dom";
import List from "@material-ui/core/List";
import ListItem from "@material-ui/core/ListItem";
import logo from '../../image/logo.svg';
import logoColor from '../../image/logo.png';
import { logicalExpression } from '@babel/types';

import SigninForm from '../commoncomponent/SigninForm';


const useStyles = makeStyles(theme => ({
  '@global': {
    ul: {
      margin: 0,
      padding: 0,
    },
    li: {
      listStyle: 'none',
    },
  },
  appBar: {
    borderBottom: `1px solid ${theme.palette.divider}`,
    background: '#ffffff',
  },
  toolbar: {
    flexWrap: 'wrap',
  },
  toolbarTitle: {
    flexGrow: 1,
  },
  link: {
    margin: theme.spacing(1, 1.5),
    textDecoration: 'none',
  },
  logo: {
    width: 290,
    //   height: 70,
  },
  menuLink: {
    margin: theme.spacing(1, 1.5),
    paddingBottom: theme.spacing(1),
    textDecoration: 'none',
    color: '#333'
  },
  activeTab: {
    borderBottom: '1px solid #000 !important',
  },
  signinBtn: {
    background: '#1B75BB',
    color: '#FFFFFF',
    textTransform: "none",
    padding: '4px 20px',
    marginLeft: theme.spacing(1),
    "&:hover": {
      background: "#1B75BB"
    },
  },
}));




export default function Header() {
  const classes = useStyles();
  const [open, setOpen] = React.useState(true);

  const handleClickOpen = () => {
    console.log('dfd')
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };
  return (
    <React.Fragment>
      <CssBaseline />
      <AppBar position="static" color="default" elevation={0} className={classes.appBar}>
        <Container fixed>
          <Toolbar className={classes.toolbar}>
            <Typography variant="h6" color="inherit" noWrap className={classes.toolbarTitle}>
              <img src={logoColor} className={classes.logo} style={{ marginTop: "1%" }}></img>
            </Typography>
            <List>
              <NavLink to="/" exact activeClassName="activeTab" className={classes.menuLink}>
                Home
            </NavLink>
              <NavLink to="/products" activeClassName="activeTab" className={classes.menuLink}>
                Products
            </NavLink>
              <NavLink to="/academia" activeClassName="activeTab" className={classes.menuLink}>
                Academia
            </NavLink>
              <NavLink to="/healthcare" activeClassName="activeTab" className={classes.menuLink}>
                Healthcare
            </NavLink>
              <NavLink to="/careers" activeClassName="activeTab" className={classes.menuLink}>
                Careers
            </NavLink>
              <NavLink to="/about" activeClassName="activeTab" className={classes.menuLink}>
                About Us
            </NavLink>
            </List>
            <Button onClick={handleClickOpen} className={classes.menuLink, classes.signinBtn}>
              Sign In
          </Button>
          </Toolbar>
        </Container>
      </AppBar>
      <SigninForm />
    </React.Fragment>
  );
}
